import TodoItem from "./TodoItem";

const TodoList = ({ data }) => {
  return (
    <div>
      <ul style={{ borderTop: "1px solid #000" }}>
        {data.map((list) => (
          <TodoItem key={list.id} list={list} />
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
